// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "./LoanBase.sol";

contract BankLoanManagement is LoanBase, ILoanApplication, ILoanApproval, ILoanRepayment, ILoanCollateral {
    uint256 public constant COLLATERAL_RATIO = 200; 
    event EtherReceived(address indexed sender, uint256 amount);

    constructor() LoanBase() {}

    // ILoanApplication
    function applyForLoan(uint256 amount, uint256 duration) external override {
        require(amount > 0, "Loan amount must be greater than 0");
        require(duration > 0, "Loan duration must be greater than 0");
        _createLoan(msg.sender, amount, duration);
    }

    function cancelApplication(uint256 loanId)   external override {
         Loan storage loan = loans[loanId];
        require(msg.sender == loan.borrower, "Only the borrower can cancel this loan");

        require(loan.status == LoanStatus.Applied,"You cant cancel An already active Loan");
       loan.status = LoanStatus.Defaulted;
        emit  ApplicationCancelled(loanId);
    }

    // ILoanApproval
    function approveLoan(uint256 loanId) external override onlyOwner {
        Loan storage loan = loans[loanId];
        require(loan.status == LoanStatus.Applied, "Loan is not in applied status");

        loan.status = LoanStatus.Approved;
        emit LoanApproved(loanId);
    }

    function rejectLoan(uint256 loanId) external override onlyOwner {
        Loan storage loan = loans[loanId];
        require(loan.status == LoanStatus.Applied, "Loan is not in applied status");

        loan.status = LoanStatus.Defaulted;
        emit LoanRejected(loanId);
    }

    // ILoanRepayment
    function makeRepayment(uint256 loanId, uint256 amount) external override nonReentrant {
        Loan storage loan = loans[loanId];
        require(loan.status == LoanStatus.Active, "Loan is not active");
        require(msg.sender == loan.borrower, "Only borrower can make repayments");

        uint256 totalDue = _calculateTotalDue(loanId);
        require(amount <= totalDue, "Repayment amount exceeds total due");

        loan.repaidAmount += amount;
        require(loanToken.transferFrom(msg.sender, address(this), amount), "Token transfer failed");

        if (loan.repaidAmount >= totalDue) {
            loan.status = LoanStatus.Completed;
            _withdrawCollateral(loanId);
        } else {
            loan.nextRepaymentDate = block.timestamp + 30 days;
        }

        emit RepaymentMade(loanId, amount);
    }

    // ILoanCollateral
    function depositCollateral(uint256 loanId) external payable override {
        Loan storage loan = loans[loanId];
        require(loan.status == LoanStatus.Approved, "Loan must be approved");
        require(msg.sender == loan.borrower, "Only borrower can deposit collateral");

        uint256 requiredCollateral = (loan.amount * COLLATERAL_RATIO) / 100;
        require(msg.value >= requiredCollateral, "Insufficient collateral");

        loan.collateralAmount = msg.value;
        loan.status = LoanStatus.Active;
        loan.nextRepaymentDate = block.timestamp + 30 days;

        // Transfer loan amount to borrower
        require(loanToken.transfer(loan.borrower, loan.amount), "Token transfer failed");

        emit CollateralDeposited(loanId, msg.value);
    }

    function withdrawCollateral(uint256 loanId) external override {
        require(msg.sender == loans[loanId].borrower, "Only borrower can withdraw collateral");
        require(loans[loanId].status == LoanStatus.Completed, "Loan must be completed to perform Collateral withdraw");

        _withdrawCollateral(loanId);
    }
     receive() external payable {
        emit EtherReceived(msg.sender, msg.value);
     }

    // Internal functions
    function _calculateInterestRate(uint256 amount, uint256 duration) internal pure override returns (uint256) {
       
        return 5 + (amount / 1e18) + (duration / 365 days);
    }

    function _calculateTotalDue(uint256 loanId) internal view returns (uint256) {
        Loan storage loan = loans[loanId];
        uint256 interest = (loan.amount * loan.interestRate * loan.duration) / (365 days * 100);
        return loan.amount + interest;
    }

    function _withdrawCollateral(uint256 loanId) internal {
        Loan storage loan = loans[loanId];
        uint256 collateralAmount = loan.collateralAmount;
        loan.collateralAmount = 0;

        (bool sent, ) = payable(loan.borrower).call{value: collateralAmount}("");
        require(sent, "Failed to send collateral");

        emit CollateralWithdrawn(loanId, collateralAmount);
    }

   
}
